import React from 'react';

const MyDashboard = () => {
  return (
    <div>
      <h1>My Dashboard</h1>
      <iframe
        title="R Markdown Dashboard"
        src="C:\Users\ellio\Documents\Projects\Websit_React\portfolio_website\public\Dash.html" 
        width="100%"
        height="600px"
      />
    </div>
  );
};

export default MyDashboard;
